import React, { Component } from "react";
import MaterialTable from "material-table";
import styles from "./styles";
import { withStyles } from "@material-ui/styles";

class StudentsList extends Component {
	constructor(props) {
		super(props);
		this.state = {
			data: {
				students: [
					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 1
					},
					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 2
					},
					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 3
					},
					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 4
					},
					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 5
					},

					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 6
					},
					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 7
					}
				]
			}
		};
	}

	columns = [
		{ title: "Name", field: "name" },
		{
			title: "Course",
			field: "course"
		},
		{
			title: "Year",
			field: "year",
			type: "numeric"
		},
		{
			title: "Branch",
			field: "branch"
		},
		{
			title: "Class Name",
			field: "className"
		},

		{
			title: "Id",
			field: "id",
			hidden: true
		}
	];
	actions = [
		{
			icon: "visibility",
			tooltip: "View Student Report ",
			onClick: (event, rowData) => {
				console.log(rowData);
			}
		}
	];

	render() {
		return (
			<div className={this.props.classes.root}>
				<MaterialTable
					columns={this.columns}
					data={this.state.data.students}
					options={{
						filtering: true,
						actionsColumnIndex: -1
					}}
					actions={this.actions}
					title="Students List"
				/>
			</div>
		);
	}
}

export default withStyles(styles)(StudentsList);
